href="https://d1tlzifd8jdoy4.cloudfront.net/wp-content/uploads/2023/04/19454e2bde09330c775e7c8862034359.png"><img loading="lazy" src="https://d1tlzifd8jdoy4.cloudfront.net/wp-content/uploads/2023/04/19454e2bde09330c775e7c8862034359-960x1707.png" alt="コネクテッドコンテントai1" width="960" height="1707" class="alignnone size-large wp-image-1054227" srcset="https://d1tlzifd8jdoy4.cloudfront.net/wp-content/uploads/2023/04/19454e2bde09330c775e7c8862034359-960x1707.png 960w, https://d1tlzifd8jdoy4.cloudfront.net/wp-content/uploads/2023/04/19454e2bde09330c775e7c8862034359-640x1138.png 640w, https://d1tlzifd8jdoy4.cloudfront.net/wp-content/uploads/2023/04/19454e2bde09330c775e7c8862034359-320x569.png 320w, https://d1tlzifd8jdoy4.cloudfront.net/wp-content/uploads/2023/04/19454e2bde09330c775e7c8862034359-768x1365.png 768w, https://d1tlzifd8jdoy4.cloudfront.net/wp-content/uploads/2023/04/19454e2bde09330c775e7c8862034359-864x1536.png 864w, https://d1tlzifd8jdoy4.cloudfront.net/wp-content/uploads/2023/04/19454e2bde09330c775e7c8862034359.png 1080w" sizes="(max-width: 960px) 100vw, 960px" /></a></p>
<h2 id="toc-2">属性情報毎にメッセージ内容を変えてみる</h2>
<p>OpenAIを使ったメッセージ生成ができることは確認できたので、ここからはコネクテッドコンテントならではの機能である<strong>パーソナライズ化したメッセージ生成</strong>ができるかも試してみます。</p>
<p>以下3つのアカウントを用意します。</p>
<h3>テストユーザーA</h3>
<ul>
<li>名前：くらにゃん</li>
<li>カスタム属性：猫</li>
</ul>
<h3>テストユーザーB</h3>
<ul>
<li>名前：関西人</li>
<li>カスタム属性：大阪</li>
</ul>
<h3>テストユーザーC</h3>
<ul>
<li>名前：ジョータロー</li>
<li>カスタム属性：JOJO</li>
</ul>
<p>テストユーザーAには「にゃん言葉」、テストユーザーBには「関西弁」、テストユーザーCには「JOJOっぽい言葉」でサンクスメッセージを出し分けるということをやってみます。</p>
<p>コネクテッドコンテントには以下のように記述します。</p>
<pre class="code line-numbers"><code class="language-javascript">{% if {{custom_attribute.${test_attribute_string}}} == "猫" %}
{% capture postbody %}
{
  "model": "gpt-3.5-turbo",
  "messages": [{"role": "user", 
  "content": "60文字以内のニャン言葉で、アクセサリーを買ってくれた人にお礼を言ってください。"}]
}
{% endcapture %}
{% elsif {{custom_attribute.${test_attribute_string}}} == "大阪" %}
{% capture postbody %}
{
  "model": "gpt-3.5-turbo",
  "messages": [{"role": "user", 
  "content": "60文字以内の関西弁で、アクセサリーを買ってくれた人にお礼を言ってください。"}]
}
{% endcapture %}


{% elsif {{custom_attribute.${test_attribute_string}}} == "JOJO" %}
{% capture postbody %}
{
  "model": "gpt-3.5-turbo",
  "messages": [{"role": "user", 
  "content": "60文字以内のJOJO風の言葉で、アクセサリーを買ってくれた人にお礼を言ってください。"}]
}
{% endcapture %}
{% else %}
{% capture postbody %}
{
  "model": "gpt-3.5-turbo",
  "messages": [{"role": "user", 
  "content": "60文字以内の日本語で、アクセサリーを買ってくれた人にお礼を言ってください。"}]
}
{% endcapture %}
{% endif %}
{% connected_content https://api.openai.com/v1/chat/completions
:method post
:body {{postbody}}
:headers {
 "Content-Type": "application/json",
 "Authorization": "Bearer APIkey"
}
:save result
%}
{{${user_id} | default: 'お客様'}}さん
{{result.choices[0].message.content}}</code></pre>
<p>このメッセージを以下の条件で配信します。</p>
<ul>
<li>購買後にアプリ内メッセージで配信</li>
<li>ほぼ購入完了と同時に画面上で表示</li>
</ul>
<p>さてさて、どんなメッセージが配信されるかにゃ。</p>
<h2 id="toc-3">配信されたメッセージ</h2>
<p>以下各ユーザー毎に配信されたメッセージです。</p>
<h3>くらにゃんに配信されたメッセージ</h3>
<p><a href="https://d1tlzifd8jdoy4.cloudfront.net/wp-content/uploads/2023/04/0cd6ce29d476473b604381d9e46e5c28.png"><img loading="lazy" src="https://d1tlzifd8jdoy4.cloudfront.net/wp-content/uploads/2023/04/0cd6ce29d476473b604381d9e46e5c28-960x1707.png" alt="コネクテッドコンテントai2" width="960" height="1707" class="alignnone size-large wp-image-1054229" srcset="https://d1tlzifd8jdoy4.cloudfront.net/wp-content/uploads/2023/04/0cd6ce29d476473b604381d9e46e5c28-960x1707.png 960w, https://d1tlzifd8jdoy4.cloudfront.net/wp-content/uploads/2023/04/0cd6ce29d476473b604381d9e46e5c28-640x1138.png 640w, https://d1tlzifd8jdoy4.cloudfront.net/wp-content/uploads/2023/04/0cd6ce29d476473b604381d9e46e5c28-320x569.png 320w, https://d1tlzifd8jdoy4.cloudfront.net/wp-content/uploads/2023/04/0cd6ce29d476473b604381d9e46e5c28-768x1365.png 768w, https://d1tlzifd8jdoy4.cloudfront.net/wp-content/uploads/2023/04/0cd6ce29d476473b604381d9e46e5c28-864x1536.png 864w, https://d1tlzifd8jdoy4.cloudfront.net/wp-content/uploads/2023/04/0cd6ce29d476473b604381d9e46e5c28.png 1080w" sizes="(max-width: 960px) 100vw, 960px" /></a><br />
にゃん言葉で指示するとこういう言葉になるニャン。</p>
